import { initializeApp } from "firebase/app";
import { getAuth } from "firebase/auth";

const firebaseConfig = {
  apiKey: process.env,
  authDomain: "doctor-portal-4b738.firebaseapp.com",
  projectId: "doctor-portal-4b738",
  storageBucket: "doctor-portal-4b738.appspot.com",
  messagingSenderId: "31241937118",
  appId: "1:31241937118:web:232ccd2596128af94da24f"
};

// Initialize Firebase

const app = initializeApp(firebaseConfig);
const auth = getAuth(app);
export default auth;
